import React, { Component } from 'react'
import Footer from './Footer'

const linkedInUrl = "https://www.linkedin.com/in/andrew-zajac-017672199"
const gitHubUrl = "https://github.com/ajzajac"

export class Contact extends Component {

    sendEmail = () => {
       var win = window.open("mailto:ajzajac@icloud.com");
       win.focus()
    }

    getLinkedIn = () => {
        var win = window.open(linkedInUrl, '_blank');
        win.focus()
    }

    goToGithub = () => {
        var win = window.open(gitHubUrl, '_blank');
        win.focus()
    }

    render() {
        return (
            <div className="contactMePage">
                <h2>Contact Me</h2>
                    <div className="emailLink">
                        {/* <a className="contacts" href="mailto:ajzajac@icloud.com">Email </a>  */}
                        {/* <a className="contacts" href="https://www.linkedin.com/in/andrew-zajac-017672199/">Linked In</a> */}
                        <img src="linkedin.png" height="110px" width="110px" onClick={this.getLinkedIn} />
                        <img src="githubLogo.jpg" height="125px" width="125px" onClick={this.goToGithub}/>
                        <img src="email.png" height="140px" width="125px"  onCLick={this.sendEmail} />
                    </div> 
                <Footer></Footer>
            </div>
        )
    }
}

export default Contact
